(578, 413, 2, 'Beatrix Otahal', '2022-05-24 13:24:59', '2022-08-24 01:31:06', '6d43bc35-9b3f-4be8-8eef-e0c3f3787d39', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Owner, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(579, 411, 2, 'René Sigrist', '2022-05-24 13:24:59', '2022-08-24 01:30:32', 'd86618c6-d4ca-4709-905e-7e90acf0532a', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'René Sigrist', 'Owner, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'I´m fascinated of uniqueness by each single project. Constantly new initial situations requires flexible thinking and a lot of empathy. To find the suitable solution for our customers I benefit of my vast experience and the cooperation with the manufacturers based on trust. The apprenticed certification to interior decorator and Master\'s degree in Service Marketing at the Lucerne University of Applied Sciences and Arts assist me comprehensive all day by practical tasks. Additionally a versatile interest and tackling topics outside of my usual environment make me stand out. Because I keep always a strong eye to the added value for customers and guests.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
