(1117, 1734, 2, 'Services', '2022-05-31 10:56:22', '2022-05-31 10:56:22', '66c5644f-454c-44d0-bb2f-80dcf3624442', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Services', '<p class=\"paragraph\">LAUTISSIMI offers holistic,<strong> individual furnishing solutions</strong> for the gastronomy, hotel, office, healthcare as well as public areas.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1118, 1734, 1, 'Services', '2022-05-31 10:56:22', '2022-05-31 10:56:22', 'f58ac46a-bc9b-499c-941c-2f05404ba563', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Leistungen', '<p class=\"paragraph\">LAUTISSIMI bietet ganzheitliche, <strong>individuelle Einrichtungslösungen</strong> für die Gastronomie, Hotellerie, Büro, Gesundheitswesen sowie öffentliche Bereiche.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1121, 1740, 2, 'References', '2022-05-31 10:57:47', '2022-05-31 10:57:47', 'a917fa04-cb44-4875-9072-6c818cc29e0b', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'References', 'Like everyone, we are reliable, experienced, efficient, flexible and personal - but at LAUTISSIMI you can expect more. \n\nWe think along with you and are surprisingly different in selected situations. Our excellent references provide proof of this.', NULL, NULL, NULL, NULL, NULL),
(1122, 1740, 1, 'References', '2022-05-31 10:57:47', '2022-05-31 10:57:47', '2c3959cb-cf0a-4a08-a3e9-d87146cbc40f', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Referenzen', 'Wie alle, sind auch wir zuverlässig, erfahren, effizient, flexibel und persönlich – aber bei LAUTISSIMI dürfen Sie mehr erwarten. \n\nWir denken mit und sind in ausgewählten Situationen überraschend anders. Unsere hervorragenden Referenzen liefern dafür den Beweis.', NULL, NULL, NULL, NULL, NULL),
