(1328, 1969, 1, 'About', '2022-06-02 21:27:48', '2022-06-02 21:27:48', 'fa5d213e-9772-4ddf-a90e-e945b11e2287', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Über uns', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">Um Ihnen und der <strong>Individualität</strong>, die sie suchen, gerecht zu werden, steht das Zuhören und achtsame Beraten bei uns an erster Stelle.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1333, 1975, 2, 'René Sigrist', '2022-06-02 21:34:22', '2022-06-02 21:34:22', 'ee716860-a265-49e3-aa21-6d828278bfa5', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'René Sigrist', 'Owner, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'I am fascinated by the uniqueness that lies in each of our projects. The ever-changing initial situations require flexible thinking and a great deal of empathy. In order to find the right product solution for our customers, I am helped not only by my many years of experience but also by the trusting cooperation with the manufacturers. My basic training as a craftsman as well as further training in marketing with a master\'s degree in services marketing at the HSLU support me in practical tasks on a day-to-day basis. A wide range of interests and the ability to tackle topics outside of my usual environment also distinguish me. Because my goal is to always keep an eye on the added value for customers and guests.\n\nTranslated with www.DeepL.com/Translator (free version)', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
