(1345, 1984, 1, 'About', '2022-06-10 16:19:50', '2022-06-10 16:19:50', 'abebc726-a61e-4a24-8848-8dff00c115a4', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'About Us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">Um Ihnen und der <strong>Individualität</strong>, die sie suchen, gerecht zu werden, steht das Zuhören und achtsame Beraten bei uns an erster Stelle.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1346, 1984, 2, 'About', '2022-06-10 16:19:50', '2022-06-10 16:19:50', '9566175d-150c-4c35-bc01-1e694cd48f7f', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'About Us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">In order to do justice to you and the <strong>individuality</strong> you are looking for, listening and attentive consultation are our top priorities.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1349, 1989, 1, 'References', '2022-06-10 16:20:05', '2022-06-10 16:20:05', 'abd20088-ad4a-4a8a-a18d-870487a42d46', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'References', 'Wie alle, sind auch wir zuverlässig, erfahren, effizient, flexibel und persönlich – aber bei LAUTISSIMI dürfen Sie mehr erwarten. \n\nWir denken mit und sind in ausgewählten Situationen überraschend anders. Unsere hervorragenden Referenzen liefern dafür den Beweis.', NULL, NULL, NULL, NULL, NULL),
(1350, 1989, 2, 'References', '2022-06-10 16:20:05', '2022-06-10 16:20:05', '14c04172-750c-4592-8dfe-aa375fa2b91e', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'References', 'Like everyone, we are reliable, experienced, efficient, flexible and personal - but at LAUTISSIMI you can expect more. \n\nWe think along with you and are surprisingly different in selected situations. Our excellent references provide proof of this.', NULL, NULL, NULL, NULL, NULL),
(1353, 1995, 1, 'Services', '2022-06-10 16:20:20', '2022-06-10 16:20:20', '29fb5913-5229-41b5-83d3-8385dd31069a', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Services', '<p class=\"paragraph\">LAUTISSIMI bietet ganzheitliche, <strong>individuelle Einrichtungslösungen</strong> für die Gastronomie, Hotellerie, Büro, Gesundheitswesen sowie öffentliche Bereiche.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1354, 1995, 2, 'Services', '2022-06-10 16:20:20', '2022-06-10 16:20:20', 'cbbbec45-c72d-4746-b045-81644db294af', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Services', '<p class=\"paragraph\">LAUTISSIMI offers holistic,<strong> individual furnishing solutions</strong> for the gastronomy, hotel, office, healthcare as well as public areas.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
