(1389, 2054, 2, 'About', '2022-08-24 01:30:01', '2022-08-24 01:30:01', 'bf5556b9-a5f2-42d7-8751-1fcbaced1258', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'About Us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\"></p>\n<p>Empathy and attention are our main goals in mind to ensure <strong>personality</strong> and success of your project </p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1390, 2054, 1, 'About', '2022-08-24 01:30:01', '2022-08-24 01:30:01', '7e2f00de-a117-4449-926c-d491838f9848', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'About Us', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<p class=\"paragraph\">Um Ihnen und der <strong>Individualität</strong>, die sie suchen, gerecht zu werden, steht das Zuhören und achtsame Beraten bei uns an erster Stelle.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1393, 2059, 2, 'René Sigrist', '2022-08-24 01:30:32', '2022-08-24 01:30:32', 'c1012d82-651e-4f19-b19d-e933ab95f9a2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'René Sigrist', 'Owner, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'I´m fascinated of uniqueness by each single project. Constantly new initial situations requires flexible thinking and a lot of empathy. To find the suitable solution for our customers I benefit of my vast experience and the cooperation with the manufacturers based on trust. The apprenticed certification to interior decorator and Master\'s degree in Service Marketing at the Lucerne University of Applied Sciences and Arts assist me comprehensive all day by practical tasks. Additionally a versatile interest and tackling topics outside of my usual environment make me stand out. Because I keep always a strong eye to the added value for customers and guests.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1394, 2059, 1, 'René Sigrist', '2022-08-24 01:30:32', '2022-08-24 01:30:32', 'a631b27a-135b-4266-90e8-a48b6e5156d2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'René Sigrist', 'Inhaber, Managing Partner', '+41 79 455 65 47', 'rene.sigrist@lautissimi.ch', 'Ich bin fasziniert von der Einzigartigkeit, die in jedem unserer Projekte steckt. Die immer wieder neuen Ausgangslagen erfordern flexibles Denken und viel Einfühlungsvermögen. Um die passende Produktlösung für unsere Kunden zu finden, helfen mir neben meiner langjährigen Erfahrung auch die von Vertrauen geprägte Zusammenarbeit mit den Herstellern. Meine handwerkliche Grundausbildung sowie Weiterbildungen im Marketing mit dem Master für Dienstleistungsmarketing an der HSLU unterstützen mich im Alltag bei praktischen Aufgaben. Ein vielseitiges Interesse und das Anpacken von Themen ausserhalb meines gewohnten Umfeldes zeichnen mich zusätzlich aus. Denn mein Ziel ist es, immer ein Auge auf dem Mehrwert für Kunden und Gäste zu behalten.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1397, 2061, 1, 'Beatrix Otahal', '2022-08-24 01:31:01', '2022-08-24 01:31:01', '0fa7db30-4113-4278-88f0-3bee5d2f104c', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences.\n\nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and  FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1398, 2061, 2, 'Beatrix Otahal', '2022-08-24 01:31:01', '2022-08-24 01:31:01', 'a4bf031a-4071-458c-aa71-332a2f1f8f4f', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Owner, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1399, 2062, 1, 'Beatrix Otahal', '2022-08-24 01:31:06', '2022-08-24 01:31:06', '4172c1f0-ef1a-4044-8b40-34dfac6ff153', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Inhaberin, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'Very early childhood ambition of interior design has been the determining begin studying architecture and economic sciences.\n\nProfessional qualifications had been acquired by working focused on topics of architecture, 3D-CAD, carpentry and  FF&E in Europe and at least in Switzerland. These decades of experience are valuable skills in technical planning, custom-made production of decorative lighting and individual interiors additional to the range of standard products. \nThe foundation of LAUTISSIMI Vienna in 2014 was markable for the beginning of my self-employment and was proceeded in 2016 with subsequent professional establishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
(1400, 2062, 2, 'Beatrix Otahal', '2022-08-24 01:31:06', '2022-08-24 01:31:06', 'c36f7e67-bc62-4f56-8e22-b5faa31fc159', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Beatrix Otahal', 'Owner, Managing Partner', '+41 78 625 50 78', 'beatrix.otahal@lautissimi.ch', 'From a very young age, it was clear that interior design was my\nmy future. The solid education allowed the\nto study architecture and commercial sciences in\ncommercial sciences in Austria.\n\nMy professional experience in the fields of\nconstruction, 3D-CAD, carpentry and FF&E I gained in\nin Europe and finally in Switzerland. This over\nyears of expertise for individual\nfurnishings and\ntailor-made, decorative\nlighting are a valuable addition to the\nmanufacturer products.\nThe founding of LAUTISSIMI Vienna in 2014 was my start to\nindependence with subsequent professional\nestablishment in Switzerland.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL),
