(1, 367, 1, '2022-05-16 14:04:10', '2022-05-16 14:04:10', 'ac5909a0-5cc2-4579-9af8-3f5254b521c5', NULL, NULL),
(2, 368, 1, '2022-05-16 14:04:14', '2022-05-16 14:04:14', '003b3027-5dd8-440b-b169-0cc0fd892850', 'Menschen im Mittelpunkt', NULL),
(3, 369, 1, '2022-05-16 14:04:17', '2022-05-16 14:04:17', 'f963b728-8c6a-4112-954f-3daf7ba93f08', 'Menschen im Mittelpunkt', 'Es sind die Menschen, die sich in den von uns eingerichteten Räumen wohl fühlen sollen. Für sie stecken wir Herzblut in unsere Produkte, Leistungen und Kundenbeziehungen. Dabei ist unser gesamtes Handeln auf Langfristigkeit ausgerichtet.'),
