(15, 381, 1, '2022-05-16 14:04:34', '2022-05-16 14:04:34', '983bfd92-7693-4bc4-bd39-e9eacf728392', 'Engagiert und gewissenhaft', NULL),
(19, 385, 1, '2022-05-16 14:04:56', '2022-08-24 01:30:01', '464aa200-149f-4910-93e6-144103b4c3b4', 'Menschen im Mittelpunkt', 'LAUTISSIMI versteht es, die nötigen\nKomponenten zusammen zu führen um\nWohlfühlzonen entstehen zu lassen. Wir\nstecken Herzblut in unsere Produkte,\nLeistungen und Kundenbeziehungen. Dabei ist\nunser gesamtes Handeln auf Langfristigkeit ausgerichtet.'),
(20, 386, 1, '2022-05-16 14:04:56', '2022-08-24 01:30:01', '7632f528-e1e3-4b0d-8c3b-01035ee68cd9', 'Mission Zukunft', 'Als solides Schweizer Unternehmen planen wir langfristig den achtsamen Umgang mit Ressourcen. Unser wachsendes Netzwerk besteht vorrangig aus regionalen Schweizer Betrieben und westeuropäischen Herstellern.'),
(21, 387, 1, '2022-05-16 14:04:57', '2022-08-24 01:30:01', '2b98feac-5936-4e19-bb0d-9a5c40103889', 'Engagiert und gewissenhaft', 'Innovation spornt uns an. Und diese suchen wir in jedem Auftrag neu. Dafür denken wir über die vertraglichen Rahmenbedingungen hinaus und geben uns nicht mit der erstbesten Lösung zufrieden. Versprochen und Hand drauf.'),
