(144, 951, 1, '2022-05-24 11:23:44', '2022-05-24 11:23:44', 'ac5e4e31-06d2-4f00-8d52-cb3846dc1f97', 'Speicherung von Zugriffsdaten in Server-Logfiles', 'Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),
(145, 952, 1, '2022-05-24 11:23:44', '2022-05-24 11:23:44', 'ad0cf45c-6ea6-4bde-8feb-64aae98ac338', 'Weitergabe personenbezogener Daten', 'Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),
(146, 953, 1, '2022-05-24 11:23:44', '2022-05-24 11:23:44', '1980c225-2d04-44fb-83ad-e362f6621348', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),
(147, 954, 1, '2022-05-24 11:23:44', '2022-05-24 11:23:44', '949f5b9b-24bf-449f-8be1-b697f915a06e', 'Kontaktformular', 'Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten'),
(156, 963, 1, '2022-05-24 11:23:54', '2022-05-31 11:22:03', '32f98ed7-86b6-4028-9809-67c9c8ce9f8d', 'Einleitung', 'Wir legen grössten Wert auf den Schutz Ihrer Daten und die Wahrung Ihrer Privatsphäre. Nachstehend informieren wir Sie deshalb über die Erhebung und Verwendung persönlicher Daten bei Nutzung unserer Webseite.\nLAUTISSIMI orientiert sich im Umgang mit Daten am Datenschutzgesetz der Schweiz (DSG) sowie an der EU-Datenschutzgrundverordnung (EU-DSGVO).'),
