(313, 1393, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'bd48dd6e-ad9f-4717-875f-022b80960c95', 'Gewährleistung und Haftung', 'LAUTISSIMI ist darum bemüht, dass die Informationen auf der Website stets auf dem aktuellen Stand sind. Trotz aller Sorgfalt können sich die Daten inzwischen verändert haben. Eine Haftung oder Garantie für die Aktualität, Richtigkeit und Vollständigkeit der zur Verfügung gestellten Informationen kann daher nicht übernommen werden.\nDes Weiteren behält sich die LAUTISSIMI das Recht vor, Änderungen oder Ergänzungen der bereitgestellten Informationen vorzunehmen.'),
(314, 1394, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '65edaa7e-fbe6-462c-91d1-7b8c778d87d0', 'Verweise und Links', 'Gleiches gilt auch für alle anderen Websites, auf die mittels Hyperlink verwiesen wird. LAUTISSIMI ist für den Inhalt der Websites, die aufgrund einer solchen Verbindung erreicht werden, nicht verantwortlich.'),
(315, 1394, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '7f3c5f8e-0dc4-40a6-b5f9-fe0ad24e211d', 'Verweise und Links', 'Gleiches gilt auch für alle anderen Websites, auf die mittels Hyperlink verwiesen wird. LAUTISSIMI ist für den Inhalt der Websites, die aufgrund einer solchen Verbindung erreicht werden, nicht verantwortlich.'),
(316, 1395, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'd8d4e9b5-3aeb-4c18-9135-dd1a023754db', 'Speicherung von Zugriffsdaten in Server-Logfiles', 'Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),
(317, 1395, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'c176986c-87fd-42a5-a5f7-0587596899bf', 'Speicherung von Zugriffsdaten in Server-Logfiles', 'Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),
(318, 1396, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '1ce0ea86-89b6-4a2a-8a0b-2d9e1ede809c', 'Weitergabe personenbezogener Daten', 'Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),
(319, 1396, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'b3571fea-e31d-48b8-99b3-9e9ba263639b', 'Weitergabe personenbezogener Daten', 'Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),
(320, 1397, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '6baaedf1-e11e-4861-9c56-56913838c0f4', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),
(321, 1397, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'ba19c880-f535-4da9-adce-4206cc271a3d', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),
(322, 1398, 1, '2022-05-25 11:31:59', '2022-05-25 11:31:59', 'a0e648ad-0f70-47e3-aad3-9503601ba3b6', 'Kontaktformular', 'Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten.'),
(323, 1398, 2, '2022-05-25 11:31:59', '2022-05-25 11:31:59', '8f1e4db9-4c9f-43e6-af79-9184283db569', 'Kontaktformular', 'Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten.'),
(340, 1815, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '3697e8aa-de64-4898-9768-0a342fa3b453', 'Introduction', 'We attach great importance to the protection of your data and the protection of your privacy. Below we therefore inform you about the collection and use of personal data when using our website.\nLAUTISSIMI is guided in its handling of data by the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO).'),
(341, 1815, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'e01b972b-806c-4395-a02d-0f5954a200d5', 'Einleitung', 'Wir legen grössten Wert auf den Schutz Ihrer Daten und die Wahrung Ihrer Privatsphäre. Nachstehend informieren wir Sie deshalb über die Erhebung und Verwendung persönlicher Daten bei Nutzung unserer Webseite.\nLAUTISSIMI orientiert sich im Umgang mit Daten am Datenschutzgesetz der Schweiz (DSG) sowie an der EU-Datenschutzgrundverordnung (EU-DSGVO).'),
(342, 1816, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '57a964b3-4425-4150-ada9-b5cce4704fbe', 'Copyright', 'The contents contained on this website are protected by copyright for LAUTISSIMI. In particular, reproductions, translations, adaptations and the storage and processing in other media, including those in electronic form, are protected by copyright. LAUTISSIMI as operator of the website permits the viewing and downloading of all content on its websites exclusively for private, non-commercial use. The contents may not be changed and used on other websites or networked computers without written permission from LAUTISSIMI. The reproduction of data or information, in particular the use of texts, parts of texts or images, requires prior written consent. For press inquiries and the editorial use of image material, please contact LAUTISSIMI (see imprint).'),
(343, 1816, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'a048e52d-b842-41a4-b08d-73ec21f24cc5', 'Urheberrecht', 'Die auf dieser Website enthaltenen Inhalte sind für LAUTISSIMI urheberrechtlich geschützt. Insbesondere Vervielfältigungen, Übersetzungen, Bearbeitungen und die Speicherung und Verarbeitung in andere Medien, einschliesslich solcher in elektronischer Form, sind urheberrechtlich geschützt. LAUTISSIMI als Betreiberin der Website gestattet das Sichten und Herunterladen sämtlicher Inhalte auf ihren Websites ausschliesslich zu privatem, nicht-kommerziellem Gebrauch. Die Inhalte dürfen nicht verändert und ohne schriftliche Genehmigung von LAUTISSIMI auf anderen Internetseiten oder vernetzten Rechnern genutzt werden. Die Vervielfältigung von Daten oder Informationen, insbesondere die Verwendung von Texten, Textteilen oder Bildmaterial, bedarf der vorherigen schriftlichen Zustimmung. Für Presseanfragen und die redaktionelle Verwendung von Bildmaterial wenden Sie sich bitte an LAUTISSIMI (siehe Impressum).'),
(344, 1817, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '4b291c37-6109-4400-b26c-c675a242ee7e', 'Warranty and liability', 'LAUTISSIMI makes every effort to ensure that the information on the website is always up to date. Despite all care, the data may have changed in the meantime. Therefore, no liability or guarantee can be assumed for the topicality, correctness and completeness of the information provided.\nFurthermore, LAUTISSIMI reserves the right to make changes or additions to the information provided.'),
(345, 1817, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'acabe8b0-6bdd-4f83-a48f-3425de72cfec', 'Gewährleistung und Haftung', 'LAUTISSIMI ist darum bemüht, dass die Informationen auf der Website stets auf dem aktuellen Stand sind. Trotz aller Sorgfalt können sich die Daten inzwischen verändert haben. Eine Haftung oder Garantie für die Aktualität, Richtigkeit und Vollständigkeit der zur Verfügung gestellten Informationen kann daher nicht übernommen werden.\nDes Weiteren behält sich die LAUTISSIMI das Recht vor, Änderungen oder Ergänzungen der bereitgestellten Informationen vorzunehmen.'),
(346, 1818, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'bab8fabc-18fc-4c77-b840-2c18dc07c8e1', 'References and links', 'The same applies to all other websites to which reference is made by means of hyperlinks. LAUTISSIMI is not responsible for the content of websites that are reached via such a link.'),
(347, 1818, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '9f51357f-51b5-41ca-b77e-77d18a030503', 'Verweise und Links', 'Gleiches gilt auch für alle anderen Websites, auf die mittels Hyperlink verwiesen wird. LAUTISSIMI ist für den Inhalt der Websites, die aufgrund einer solchen Verbindung erreicht werden, nicht verantwortlich.'),
(348, 1819, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '6bc6d813-3c4e-4c53-9df2-d69fbec5038c', 'Storage of access data in server log files', 'You can visit our website without providing any personal information. We only store access data in so-called server log files, such as the name of the requested file, date and time of the request, amount of data transferred and the requesting provider. These data are evaluated exclusively to ensure trouble-free operation of the site and to improve our offer and do not allow us to draw any conclusions about your person.\nWe collect personal data if you voluntarily provide it to us when contacting us (e.g. via contact form or e-mail). Which data is collected can be seen from the respective input forms; in doing so, we adhere to the principles of data avoidance and data economy. We use the data you provide to process the contract and to handle your inquiries. After complete processing of the contract or deletion of your customer account, your data will be blocked for further use and deleted, unless you have expressly consented to further use of your data or we reserve the right to use data beyond this, which is permitted by law.'),
(349, 1819, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '59e5e40e-e49b-4d6e-b608-e384e8f6fa34', 'Speicherung von Zugriffsdaten in Server-Logfiles', 'Sie können unsere Website besuchen, ohne Angaben zu Ihrer Person zu machen. Wir speichern lediglich Zugriffsdaten in sogenannten Server-Logfiles, wie z.B. den Namen der angeforderten Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge und den anfragenden Provider. Diese Daten werden ausschliesslich zur Sicherstellung eines störungsfreien Betriebs der Seite und zur Verbesserung unseres Angebots ausgewertet und erlauben uns keinen Rückschluss auf Ihre Person.\nWir erheben personenbezogene Daten, wenn Sie uns diese im Rahmen einer Kontaktaufnahme mit uns (z.B. per Kontaktformular oder E-Mail) freiwillig mitteilen. Welche Daten erhoben werden, ist aus den jeweiligen Eingabeformularen ersichtlich, dabei halten wir uns an die Grundsätze der Datenvermeidung und Datensparsamkeit. Wir verwenden die von Ihnen mitgeteilten Daten zur Vertragsabwicklung und Bearbeitung Ihrer Anfragen. Nach vollständiger Abwicklung des Vertrages oder Löschung Ihres Kundenkontos werden Ihre Daten für die weitere Verwendung gesperrt und gelöscht, sofern Sie nicht ausdrücklich in eine weitere Nutzung Ihrer Daten eingewilligt haben oder wir uns eine darüberhinausgehende Datenverwendung vorbehalten, die gesetzlich erlaubt ist.'),
(350, 1820, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'c028ea60-6ecf-47a0-9c45-19c9e0c150b6', 'Disclosure of personal data', 'Your data will not be passed on to third parties without your express consent. The only exceptions to this are our service partners, which we need to process the contractual relationship, as well as if there is a legal obligation to disclose or the disclosure is necessary for any criminal prosecution and is permitted by law. In these cases, we strictly observe the requirements of the Swiss Data Protection Act (DSG) and the EU General Data Protection Regulation (EU-DSGVO). The scope of the data transfer is limited to a minimum.'),
(351, 1820, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'f8ee0020-2a78-48e5-9a38-78bd84be420d', 'Weitergabe personenbezogener Daten', 'Eine Weitergabe Ihrer Daten an Dritte ohne Ihre ausdrückliche Einwilligung erfolgt nicht. Ausgenommen hiervon sind lediglich unsere Dienstleistungspartner, die wir zur Abwicklung des Vertragsverhältnisses benötigen, sowie wenn eine gesetzliche Pflicht zur Weitergabe besteht oder die Weitergabe für eine etwaige Strafverfolgung nötig und gesetzlich zugelassen ist. In diesen Fällen beachten wir strikt die Vorgaben des Datenschutzgesetzes der Schweiz (DSG) sowie der EU-Datenschutzgrundverordnung (EU-DSGVO). Der Umfang der Datenübermittlung beschränkt sich auf ein Mindestmass.'),
(352, 1821, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', 'b95d4abc-d551-44f4-a29d-c98e655ccadf', 'Usage of cookies', 'In order to make visiting our website more attractive and to enable the use of certain functions, we use so-called cookies on various pages. These are small text files that are stored on your terminal device. Some of the cookies we use are deleted at the end of the browser session, i.e. after you close your browser (so-called session cookies). Other cookies remain on your end device and allow us to recognize your browser on your next visit (persistent cookies). You can set your browser so that you are informed about the setting of cookies and decide individually about their acceptance or exclude the acceptance of cookies for certain cases or in general. If you do not accept cookies, the functionality of our website may be limited.'),
(353, 1821, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '4488afdb-6fa1-4fa3-8d05-7e914cf1e963', 'Verwendung von Cookies', 'Um den Besuch unserer Website attraktiv zu gestalten und die Nutzung bestimmter Funktionen zu ermöglichen, verwenden wir auf verschiedenen Seiten sogenannte Cookies. Hierbei handelt es sich um kleine Textdateien, die auf Ihrem Endgerät gespeichert werden. Einige der von uns verwendeten Cookies werden nach Ende der Browser-Sitzung, also nach Schliessen Ihres Browsers, wieder gelöscht (sog. Sitzungs-Cookies). Andere Cookies verbleiben auf Ihrem Endgerät und ermöglichen uns, Ihren Browser beim nächsten Besuch wiederzuerkennen (persistente Cookies). Sie können Ihren Browser so einstellen, dass Sie über das Setzen von Cookies informiert werden und einzeln über deren Annahme entscheiden oder die Annahme von Cookies für bestimmte Fälle oder generell ausschliessen. Bei der Nichtannahme von Cookies kann die Funktionalität unserer Website eingeschränkt sein.'),
(354, 1822, 2, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '23a41fee-6528-4151-b4a4-9424e6565d77', 'Contact form', 'If you contact us via the contact form on our website, the data is transmitted in encrypted form to ensure appropriate security of this data.'),
(355, 1822, 1, '2022-05-31 11:22:03', '2022-05-31 11:22:03', '4815ee3f-c986-46f8-a668-ebef852b7f8c', 'Kontaktformular', 'Wenn Sie mit uns über das Kontaktformular auf unserer Website in Kontakt treten, so werden die Daten verschlüsselt übertragen, um eine angemessene Sicherheit dieser Daten zu gewährleisten.');
